import React from "react";

const Navbar = () => {
  return (
    <nav>
      {
        /* Need links to homepage, categories, blogs, and about. About will be implemented later */

        /* Homepage */
        <>
          {/* Need links to homepage, categories, blogs, and about. About will be
          implemented later */}
          <a href="/">Homepage</a>
          {/* Categories */}
          <a href="/categories">Categories</a>
          {/* Blogs */}
          <a href="/blogs">Blogs</a>
        </>
      }
    </nav>
  );
};

export default Navbar;
